import logo from './logo.svg';
import './App.css';
import CategorySummary from './components/CategorySummary'; //importering av komponenten 

console.log("App loaded");

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
          </header>
          <main>
              {console.log("Rendering CategorySummary")}
              <CategorySummary />
          </main>
    </div>
  );
}

export default App;
